(1, '1234', 'Español', 'repositorio/cursos/1.jpg', 1, '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>El español o castellano es una lengua romance procedente del latín hablado. Pertenece al grupo ibérico y es originaria de Castilla, reino medieval de la península ibérica. Se conoce también por el americanismo coloquial de castilla (por ejemplo: &laquo;hablar castilla&raquo;, &laquo;entender castilla&raquo;),nota​ común en algunas áreas rurales e indígenas entre México, Perú y la Patagonia, pues el castellano se empezó a enseñar poco después de la incorporación de los nuevos territorios a la Corona de Castilla.</p>\r\n</body>\r\n</html>\r\n', 1, '2020-07-06 16:20:27', '2020-07-08 10:59:13', 'unknown', 2, 0),
